import React from 'react'

export default function Select(props) {
  return (
    <div><select onChange={props.onChangeFn}>
    <option>{props.defultOpt}</option>
    {props.options.map(option => <option value={option}>{option}</option>)}
  </select>
  </div>
  )
}
